import React from "react";
import { Link } from "react-router-dom";

const DUMMY_QUOTES = [
  {
    id: 'q1',
    author: 'Amey A.',
    text: 'Learning React Is Fun.'

  },
  {
    id: 'q2',
    author: 'Diya P',
    text: 'Learning React Is Boring.'

  },
  {
    id: 'q3',
    author: 'Amey A.',
    text: 'No it really is.'

  },
]

const AllQuotes = () => {
  return <div>
    <h1>All Quotes</h1>
    <ul>
      <li><Link to='/quotes/quote/Apple'>Apple</Link></li>
      <li><Link to='/quotes/quote/Doctor'>Doctor</Link></li>
      <li><Link to='/quotes/quote/Something'>Something</Link></li>
    </ul>
  </div>;
};

export default AllQuotes;
